// 定义与JSON数据结构相匹配的结构体
type CourseData struct {
	CourseID           int    `json:"courseId"`
	CourseName         string `json:"courseName"`
	Grades             []int  `json:"grades"`
	Subjects           []int  `json:"subjects"`
	LearnSeason        int    `json:"learnSeason"`
	Year               int    `json:"year"`
	Status             int    `json:"status"`
	CreateTime         int    `json:"createTime"`
	NewCourseType      int    `json:"newCourseType"`
	SuggestedGradeIds  []int  `json:"suggestedGradeIds"`
	FirstLessonTime    int    `json:"firstLessonTime"`
	LastLessonStopTime int    `json:"lastLessonStopTime"`
}

type InnerData struct {
	Data map[int]CourseData `json:"data"`
}

type CourseDataResponse struct {
	ErrNo  int       `json:"errNo"`
	ErrStr string    `json:"errStr"`
	Data   InnerData `json:"data"`
}

